import React from 'react';


function video () {
    return (
        <video className="video" autoPlay loop>
            <source src="video.mp4"></source>
        </video>
    )
}

function grid () {
    return (
        <>
            <div className="grid">
                
            </div>
        </>
    )
}

export default video;

export {grid};
